import Repository from './Repository';

const resource = "/post";

export default {
    get(){
        Repository.get(resource);
    },

    getPost(postId){
        Repository.get(resource + "/" + postId);
    },

    createPost(payload){
        Repository.post(resource, payload);
    },

    updatePost(postId, payload){
        Repository.put(resource + "/" + postId, payload);
    },

    delete(postId){
        return Repository.delete(resource + "/" + postId);
    }
}
